Почитай, что такое капитализм. Капитализм даёт право создавать капитал (заводы, фабрики и т.д.) для частного использования ради получения прибыли. Без капитализма не было бы у тебя телефона, без капитализма не было бы у тебя телевизора, без капитализма не было WI-FI сети и ещё много чего. Вбей в поисковик:
